(1, 'Di Indonesia banyak sekali budaya dan kesenian \r\nyang sudah dikenal luas oleh dunia. Warga \r\nduniapun banyak yang tidak hanya menikmatinya,\r\nnamun juga turut serta mencoba lebih dekat dengan\r\nkebudayaan Indonesia. Kita sudah sepatutnya \r\nbangga dan turut melestarikan kebudayaan \r\nIndonesia.');

