INSERT INTO `edit_beranda` (`id`, `judul`, `deskripsi`, `foto`) VALUES
(1, 'Wayang Kulit', 'Kesenian dari kulit kerbau yang berasal dari Jawa \r\nini adalah satu dari jutaan kesenian budaya \r\ndi Indonesia yang paling terkenal. Banyak turis mancanegara \r\nyang datang ke Indonesia untuk belajar tentang wayang.\r\nDalam pertunjukan wayang selalu mempunyai simbol \r\ndan makna filosofis. Pertunjukan wayang telah diakui \r\noleh UNESCO pada tanggal 7 November 2003\r\nsebagai karya kebudayaan \r\nyang mengagumkan dalam Bidang Cerita Narasi \r\ndan Warisan yang Indah dan Berharga.', ''),
(2, 'Angklung', 'Alat musik bernada ganda ini berasal dari Jawa Barat. \r\nBahan dasar yang digunakan dalam alat musik ini adalah bambu. \r\nAngklung dimainkan dengan cara digetarkan, sehingga \r\npipa pipa bambu akan bergetar dan menghasilkan nada \r\ntertentu. Selain fungsi sebagai alat musik, angklung \r\nberfungsi sebagai salah satu alat dalam upacara adat \r\nuntuk mengundang Dewi Sri atau dewi kemakmuran \r\nuntuk turun ke bumi dan memberikan kesuburan pada padi.\r\nAngklung dinobatkan sebagai Karya Agung Warisan Budaya Lisan \r\ndan Nonbendawi Manusia oleh UNESCO pada bulan November 2010 \r\ndan telah menjadi salah satu budaya asli Indonesia yang mendunia.', ''),
(3, 'Keris', 'Alat musik bernada ganda ini berasal dari Jawa Barat.\n Bahan dasar yang digunakan dalam alat musik ini \nadalah bambu. Angklung dimainkan dengan cara digetarkan, \nsehingga pipa pipa bambu akan bergetar dan menghasilkan \nnada tertentu. Selain fungsi sebagai alat musik, angklung \nberfungsi sebagai salah satu alat dalam upacara adat \nuntuk mengundang Dewi Sri atau dewi kemakmuran \nuntuk turun ke bumi dan memberikan kesuburan pada \npadi., Angklung dinobatkan sebagai Karya Agung Warisan \nBudaya Lisan dan Nonbendawi Manusia oleh UNESCO \npada bulan November 2010 dan telah menjadi salah \nsatu budaya asli Indonesia yang mendunia.', ''),
(4, 'Batik', 'Siapa yang tak kenal kebudayaan asli Indonesia \nselanjutnya ini? Setiap orang Indonesia pasti memiliki \ndan pernah memakai batik, baik corak tradisional \nmaupun yang dengan corak modern. \nBatik adalah kain bergambar yang memiliki \nproses pembuatan khusus yaitu menorehkan malam \n(lilin tradisional) menggunakan canting di atas kain \nsebelum kemudian melewati proses pewarnaan yang \njuga alami.\r\nHampir semua daerah di Indonesia memiliki motif \natau corak batik khas dan masing-masing memiliki filosofi.\nBatik telah mendapatkan penghargaan dari UNESCO \npada tanggal 2 Oktober 2009 sebagai \nWarisan Budaya Lisan dan Nonbendawi Manusia.', ''),
(5, 'Tari Saman', 'Tari Saman ialah ikon kebanggaan sekaligus kebudayaan Indonesia dari Provinsi Aceh. Tarian ini berasal dari Suku Gayo dan telah dikenal oleh dunia. Hampir di setiap sekolah di Indonesia memiliki kegiatan Tari Saman dan diikutsertakan dalam perlombaan nasional. \r\n\r\nTari Saman termasuk salah satu tarian yang unik, karena hanya menampilkan gerak tepuk tangan, anggota tubuh bagian atas, dan lutut, namun bisa menciptakan gerakan yang mempesona. Kunci tarian ini terletak pada kekompakan gerakan para penari, di mana mereka harus bergerak serentak mengikuti irama musik dengan tempo yang cepat.', ''),
(6, 'Tari Kecak', 'Tari Kecak tercipta dari perpaduan seni, budaya, \ndan kisah mistik. Tari Kecak adalah salah satu tarian \nyang paling populer bagi wisatawan yang berkunjung \nke Bali. Keunikan Tari Kecak ialah hanya dengan \nmelantunkan suara “cak,cak,cak” secara tegas dan \nberulang-ulang hingga memiliki irama, dan dengan \ngerakan tangan para penari yang kompak, lama \nkelamaan kamu akan merasa terhipnotis. \nPada saat tarian sedang berlangsung, kamu akan \ndisuguhkan pertunjukan teater singkat tentang cerita \nRama dan Shinta.', ),
(7, 'Reog Ponorogo', 'Reog Ponorogo adalah pertunjukan seni  yang berasal \ndari Jawa Timur, tepatnya di Kota Ponorogo. \nGerbang Kota Ponorogo dihiasi oleh sosok warok \ndan gemblak, sosok dalam pertujukan reog. \nReog adalah salah satu kebudayaan di Indonesia \nyang masih sangat kental dengan hal-hal yang berbau \nmistik. Dalam seni pertunjukan reog biasanya tidak \nmengikuti skenario yang telah disusun dan terkadang \nada interaksi antara pemain reog dan penonton. \r\n\r\nPemain Reog Ponorogo memakai topeng yang cukup \nbesar, beratnya bisa mencapai 50 kilogram dan \ntopeng tersebut disangga hanya menggunakan gigi. \nMungkin hal ini terdengar tidak nyata, namun hal ini bisa \nterjadi karena latihan fisik serta latihan secara spiritual.', '');
INSERT INTO `edit_beranda` (`id`, `judul`, `deskripsi`, `foto`) VALUES
(8, 'Tari Pendet', 'Selain Tari Kecak, Bali juga memiliki Tari Pendet. \nTari Pendet merupakan tarian tertua di Pulau Dewata, \ndiperkirakan telah ada sejak tahun 1950. Selain berfungsi \nsebagai tarian ucapan selamat datang, juga merupakan \ntarian untuk ritual keagamaan. Tarian ini dibawakan oleh \nputri dan sang penari juga membawa mangkuk perak \nyang berisikan bunga. Kebudayaan asli Indonesia ini \npertama kali dipentaskan ke dunia saat ajang Asean \nGames tahun 1960 yang dibuka oleh Presiden Soekarno.', ),
(9, 'Gamelan', 'Seni kebudayaan Indonesia lainnya yang populer \ndi panggung dunia adalah Gamelan. Gamelan sendiri \nmerupakan musik ansambel tradisional Jawa, Sunda, \ndan Bali di Indonesia yang memiliki tangga nada \npentatonis dalam sistem tangga nada (laras) slendro \ndan pelog. \r\n\r\nAda banyak instrumen untuk melengkapi ansambel Gamelan mulai dari gangsa, gender, bonang, gong, saron, slenthem, gambang, seruling, rebab hingga kendhang yang dimainkan dengan tangan. Sebagai pelengkap musik gamelan juga diiringi merdunya Sindhen yang melantunkan lagu-lagu khas', ),
(16, 'yguj', 'yguj', '');

